        if (air  1) {
            in_air = true;
        } else {
            in_air = false;
        }
        timed1 = false;
    }
    if (Input.IsKeyPressed(0x20)){
        return;
    }
    if (lastAircheck == true && in_air==false)
    {
        if (delayedPos==0 && firstRun==false) {
            firstRun=true;///u s e r:90
        }
        runMainFunction=1;
    }
    if (runMainFunction==1){
        if (timed == false) {
            lastTime = Globals.Curtime();
            timed = true;
