Cheat.ExecuteCommand("say I'm using OTC ") // 聊天框发送I'm using OTC

Cheat.FrameStage(): number
该函数用于返回OT框架当前执行状态



Stage
Meaning




0
Frame Start 框架加载


1
Frame NetUpdate Start 框架在线更新启动


2
Frame NetUpdate PostDataUpdate Start 框架公告数据在线更新启动


3
Frame NetUpdate PostDataUpdate End 框架公告数据在线更新结束


4
Frame NetUpdate End 框架在线更新结束


5
Frame Render Start 框架渲染开始


6
Frame Render End 框架渲染结束



使用示例:
var currentStage = Globals.FrameStage();
Cheat.Print(currentStage);
